/**
 * You are given a string, s, and a list of words, words, that are all of the same length. Find all starting indices of substring(s) in s that is a concatenation of each word in words exactly once and without any intervening characters.
 *
 * Example 1:
 *
 * Input:
 *   s = "barfoothefoobarman",
 *   words = ["foo","bar"]
 * Output: [0,9]
 * Explanation: Substrings starting at index 0 and 9 are "barfoor" and "foobar" respectively.
 * The output order does not matter, returning [9,0] is fine too.
 * Example 2:
 *
 * Input:
 *   s = "wordgoodgoodgoodbestword",
 *   words = ["word","good","best","word"]
 * Output: []
 */

// normal solution, time limit exceeded
fn find_substring_normal(s: String, words: Vec<String>) -> Vec<i32> {
  let mut temp = vec![];

  if let Some(v) = words.first() {
    use std::collections::HashMap;

    let word_size = v.len();
    let unit_size = words.len() * word_size;

    let mut words_set = HashMap::new();
    for v in words {
      *words_set.entry(v).or_insert(0) += 1;
    }

    // use "checked_mul()" to avoid that make uszie < 0
    for i in 0..=s.len().checked_mul(unit_size).unwrap_or(0) {
      let mut match_words = HashMap::new();
      for i in (i..i + unit_size).step_by(word_size) {
        if let Some(word) = s.get(i..i + word_size) {
          *match_words.entry(word.into()).or_insert(0) += 1;
        }
      }
      if match_words == words_set {
        temp.push(i as i32);
      }
    }
  }

  temp
}

// save, update and reuse the list of the match words
fn find_substring(s: String, words: Vec<String>) -> Vec<i32> {
  let mut temp = vec![];

  if let Some(v) = words.first() {
    use std::collections::{HashMap, VecDeque};

    let (word_size, word_count) = (v.len(), words.len());
    let unit_size = word_size * word_count;

    let mut words_set = HashMap::new();
    for v in words {
      *words_set.entry(v).or_insert(0) += 1;
    }

    for char_offset in 0..word_size {
      let (mut word_quence, mut match_words) = (VecDeque::new(), HashMap::new());

      for char_start in (char_offset..s.len()).step_by(word_size) {
        if let Some(word) = s.get(char_start..char_start + word_size) {
          let word = word.to_string();
          *match_words.entry(word.clone()).or_insert(0) += 1;
          word_quence.push_back(word);

          if word_quence.len() > word_count {
            // remove the first element in the sequence when the sequence length over the target value
            if let Some(head) = word_quence.pop_front() {
              // update the content of the words map
              match_words.get_mut(&head).map(|v| *v -= 1);
              if match_words.get(&head) == Some(&0) {
                match_words.remove(&head);
              }
            }
          }

          // if the words match the target, save the start index
          if match_words == words_set {
            let char_last = char_start + word_size;
            temp.push((char_last - unit_size) as i32);
          }
        }
      }
    }
  }

  temp
}

